var jsconfig;

// update tree
function updateTree(){
 	jQuery('div#jstree').jstree("destroy");
 	jQuery.getJSON(_path_get_tree,function(data){
			jsconfig(data);
	});
}

jQuery(function(){

	function getNodeFromE(e){
		return jQuery('#jstree').jstree(true).get_node(e.reference.context.id);
	};

	function getNodeFromId(id){
		return jQuery('#jstree').jstree(true).get_node(id);
	};

	function deleteRest(url,data,success,error){
		jQuery.ajax({
			url: url,
			type: 'POST',
			data: JSON.stringify(data),
			contentTYpe: 'application/json; charset=utf-8',
			dataType: 'json',
			success: success,
			error: error
		})
	}

	jsconfig = function (jsData) {
		jQuery('#jstree').jstree({
		  	"core": {
			  	"check_callback": true,
			  	"data": jsData
			},
		  	"contextmenu": {
				"items": {
				  	"new_factory": {
				  		"label": "New Factory",
				  		"action": function(e) {
				  			var node = getNodeFromE(e);
				  			if(node.original.type !== 'ROOT')
				  			{
				  				alert('You can only create factories for roots');
				  			}
				  			else
				  			{
				  				var scope = angular.element('div#newFactory').scope();
				  				scope.factory.rootId = node.id;
				  				scope.$apply();
				  				jQuery('div#newFactory').modal('show');
				  			}
				  		}
				  	},
				  	"generate_output" : {
				  		"label": "Generate Output",
				  		"action": function(e) {
				  			var node = getNodeFromE(e);
				  			if(node.original.type !== 'FACTORY')
				  			{
				  				alert('You can only generate outputs for factories.');
				  			}
				  			else
				  			{
				  				var scope = angular.element('div#generateOutput').scope();
				  				var range = node.original.upperBound - node.original.lowerBound;

				  				scope.output.factoryId = node.id;
				  				scope.output.limit = range < 16 ? range : 15;

				  				scope.$apply();
				  				jQuery('div#generateOutput').modal('show');
				  			}
				  		}
				  	},
				  	"delete": {
				  		"label": "Delete",
				  		"action": function(e){
				  			var node = getNodeFromE(e), data, success, error;
				  			switch(node.original.type)
				  			{

				  				case 'OUTPUT':
				  					// Need to send factory id and text value
				  					data = {
				  								"factoryId": node.parent, 
				  								"outputText": node.text
				  							};

				  					// Set correct url for delete factory output
				  					url = _path_delete_factory_output;
				  					break;
				  				default:
				  					// Need to get id
				  					data = {
				  						"id": node.id,
				  						"type": node.original.type
				  					};

				  					// Set correct url
				  					url = _path_delete_tree_node;
				  			}

				  			// Ajax delete node
		  					deleteRest(url,data,
		  						function(){
		  							jQuery('div#jstree').jstree(true).delete_node(node);
		  							socket.emit('tree update');
		  						},
		  						function(){
		  							alert('Could not delete node.');
		  						}
		  					);
				  		}
				  	}
				  }
		  },
		  "plugins" : [
		    "contextmenu", "dnd", "search",
		    "state", "types", "wholerow"
		  ]
		});
	}

	jQuery.getJSON(_path_get_tree,function(data){
	  			jsconfig(data);
	  		});
});
var app = angular.module('app',
	[],
	function($interpolateProvider){
		$interpolateProvider.startSymbol('{|');
		$interpolateProvider.endSymbol('|}');
	});
var createRootCtrl = function($scope, $http){

	$scope.root = {
		id: null,
		text: null
	};

	$scope.create = function(){
		$http.post(_path_create_root, $scope.root).
			success(function(data, status, headers, config){
				var root = {
					"id": data.id,
					"type": "ROOT",
					"text": $scope.root.text
				};

				jQuery('div#jstree').jstree(true).create_node('#',root,"last",function(){
					jQuery('div#createRoot').modal('hide');

					// Tell everyone else to update
					socket.emit('tree update');
				});
			}).error(function(data, status, headers, config){
				alert("Couldn't create root node");
				console.log(data);
			});
	};
};

app.controller('createRootCtrl',
	['$scope','$http',createRootCtrl]);
var generateOutputCtrl = function($scope, $http){
	$scope.output = {
		factoryId: null,
		limit: null,
		number: null
	};

	$scope.generate = function(){
		$scope.output.number = parseInt($scope.output.number);

		if($scope.output.number < 1 || $scope.output.number > $scope.output.limit )
		{
			alert("Could not generate more outputs than the limit");
			return;
		}

		$http.post(_path_generate_output, $scope.output).
			success(function(data, status, headers, config){
				var children = jQuery('div#jstree').jstree(true).get_children_dom($scope.output.factoryId);
				for(var i = 0; i < children.length; i ++)
				{
					jQuery('div#jstree').jstree(true).delete_node(children[i]);
				}

				// Add new factory, this conveniently doesn't have any children
				jQuery('div#jstree').jstree(true).create_node(newFactory.rootId, newFactory,"last");

				for(var i = 0; i < data.output.length; i ++)
				{
					var node = {
						"id": Math.random()*100000000,
						"text": data.output[i],
						"type": "OUTPUT"
					};
					jQuery('div#jstree').jstree(true).create_node($scope.output.factoryId,node,"last");
				}
				jQuery('div#generateOutput').modal('hide');

				// Tell everyone else to update
				socket.emit('tree update');
			}).error(function(data, status, headers, config){
				alert("Couldn't generate output");
				console.log(data);
			});
	};
};

app.controller('generateOutputCtrl',
	['$scope','$http',generateOutputCtrl]);
var newFactoryCtrl = function($scope, $http){
	$scope.factory = {
		id: null,
		rootId: null,
		text: null,
		lowerBound: null,
		upperBound: null
	};

	$scope.create = function(){

		var lb = $scope.factory.lowerBound;
		var ub = $scope.factory.upperBound;

		if($scope.factory.text == null)
		{
			alert("Please fill in a factory name.");
			return;
		}

		if(!isNaN(ub) && !isNaN(lb))
		{
			ub = parseInt(ub);
			lb = parseInt(lb);

			$scope.factory.lowerBound = lb;
			$scope.factory.upperBound = ub;

			if(ub >= lb)
			{
				$http.post(_path_create_factory, $scope.factory).
							success(function(data, status, headers, config){
								var factory = {
									"id": data.id,
									"text": $scope.factory.text + $scope.factory.lowerBound + " - " + $scope.factory.upperBound,
									"type": "FACTORY",
									"lowerBound": $scope.factory.lowerBound,
									"upperBound": $scope.factory.upperBound
								};

								jQuery('div#jstree').jstree(true).create_node($scope.factory.rootId, factory,"last",function(){
									jQuery('div#newFactory').modal('hide');

									// Tell everyone else to update
									socket.emit('tree update');
								});
							}).error(function(data, status, headers, config){
								alert("Could not create factory.");
								console.log(data);
							});
			}
			else
			{
				alert("Could not create factory. Your upper bound must be greater than your lower bound.");
			}
		}
		else
		{
			alert("Could not create factory. Your bounds need to be numbers.");
		}
	};
};

app.controller('newFactoryCtrl',
	['$scope','$http',newFactoryCtrl]);
